import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/home';
import LabaduhRoute from './f-routes/labaduhRoutes'; 
import ListCus from './f-routes/listCusRoutes.js'; 
import AuthS from './pages/signup.js'; 
import AuthL from './pages/login.js'; 
import Header from '../components/header'; // Import Header component
import Footer from '../components/footer'; // Import Footer component



import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
      <Header /> {/* Include Header component */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/signup" element={<AuthS />} />
          <Route path="/login" element={<AuthL />} />
          <Route path="/labaduh/*" element={<LabaduhRoute/>} />
          <Route path="/labaduhh/*" element={<ListCus/>} />

        </Routes>
      </div>
    </Router>
  );
};

export default App;
